[extruder]
## In M0 position
### Vz-HextrudORT
step_pin: PE3
dir_pin: !PF13
enable_pin: !PF14
microsteps: 32
Gear_ratio: 50:8
rotation_distance: 26.40
nozzle_diameter: 0.4
filament_diameter: 1.750

heater_pin: PB0
sensor_type: PT1000
sensor_pin: PF4

#control: pid
#pid_Kp=28.737 
#pid_Ki=1.935 
#pid_Kd=106.684
min_temp: 0
max_temp: 400
full_steps_per_rotation: 200
max_extrude_only_distance: 1000.0
max_extrude_cross_section: 500
max_extrude_only_velocity: 200
max_extrude_only_accel: 10000
min_extrude_temp: 180
pressure_advance: 0.045
pressure_advance_smooth_time: 0.03

[tmc2209 extruder]
uart_pin: PF12
interpolate: true
run_current: 0.7
sense_resistor: 0.110

########################
########################

[heater_bed]
heater_pin: PE5
sensor_type: Generic 3950
sensor_pin: PC1
#control: pid
#pid_Kp: 66.746
#pid_Ki: 3.504
#pid_Kd: 317.878
min_temp: 0
max_temp: 130


########################
#### FANS ##############
########################

[fan]
##	Print Cooling Fan - PF8
pin: PF8
max_power: 1
cycle_time: 0.002
hardware_pwm: false
shutdown_speed: 0

[heater_fan hotend_fan]
pin: PD14
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[multi_pin exhaust_fan_pins]
pins: PA15, PB11

[controller_fan exhaust_Fan] 
pin: multi_pin:exhaust_fan_pins
max_power: 1.0
fan_speed: 1.0
shutdown_speed: 0
kick_start_time: 0.2
off_below: 0.25
stepper: stepper_x, stepper_y, stepper_z, extruder

[idle_timeout]
timeout: 600
gcode =
  {% if printer.pause_resume.is_paused %}
    M104 S0
  {% else %}
    TURN_OFF_HEATERS
    SET_PIN PIN=LED value=0
    #M84
  {% endif %}

[exclude_object]

[gcode_arcs]

[axis_twist_compensation]
#speed: 50
horizontal_move_z: 2.5
calibrate_start_x: 20
calibrate_end_x: 215
calibrate_y: 117.5
calibrate_start_y: 40
calibrate_end_y: 215
calibrate_x: 117.5


